(49, 'Robert Walker', 'durbanmomo@gmail.com', '668-086-324-5884', 'INDIVIDUAL INVESTOR', NULL, 'Hello, good day.\r\n\r\nI first learned of True Share\'s ETFs soon after inception, but both volumes were so low, it was difficult for me to acquire. I am glad this has changed. I have a simple question, but I couldn\'t find an answer with all the information provided. I am still an amateur trader, so forgive me if this is a somewhat dumb question.\r\n\r\nMy question is this - will LRNZ modify its holdings over time? I am interested in buying stock of Snowflake (once it becomes public), but if it will end up being included in this fund,  my overall portfolio management may differ somewhat. Where can this information be found, so I can find out on my own in the future?\r\n\r\nAppreciate the reply.. Have a nice Labor Day.\r\n\r\nRobert', '2020-09-07 13:42:23', '2020-09-07 13:42:23'),
(50, 'Michael Reis', 'mikereis@gmail.com', NULL, 'INDIVIDUAL INVESTOR', NULL, 'Hello,\r\n\r\nI have a question about your structured outcome ETFs. Using SEPZ as an example, how is the expected upside participation rate calculated? When I look at the fund holding, it appears that the ratio of puts sold to calls owned  of approximately 5:4. Perhaps I am estimating the deltas differently but I am getting a participation rate of closer to 70%.\r\n\r\nThank you for any clarification that you could provide.', '2020-09-14 21:24:59', '2020-09-14 21:24:59'),
