(1, 'LRNZ', 'TrueShares Technology, AI and Deep Learning ETF', NULL, NULL, NULL, 'banner-1581938212-hero-bg.jpg', '2020-02-28', 'LRNZ', 'LRNZ', '<p>Seeks to provide total return by investing in&nbsp;companies that incorporate high levels of Artificial Intelligence into their businesses.</p>', '<p>LRNZ seeks to provide total return&nbsp;by investing in an actively managed, concentrated portfolio of companies that are signiﬁcantly involved in the application of high levels of artiﬁcial intelligence.</p>\n\n<ul>\n	<li>Intends to serve as a more focused alpha seeking solution to complement traditional technology-based indices</li>\n	<li>Targets companies with leading-edge artiﬁcial intelligence, machine learning, or deep learning technology&nbsp;platforms, algorithms, or applications that we believe may provide distinct competitive advantages in an industry historically characterized by a winner-take-all consolidation behavior.&nbsp;</li>\n	<li>Portfolio construction begins with a multi-cap investment universe comprised of secular growth companies, cyclical growth companies, and newly public companies.</li>\n	<li>&nbsp;Actively managed by highly credentialed artiﬁcial intelligence specialist with deep field experience and robust Silicon Valley network.</li>\n</ul>', NULL, NULL, '<p>* As of 09/30/2020</p>\n\n<p>&nbsp;</p>', '<p>IOPV, or Indicative Optimized Portfolio Value, is a calculation disseminated by the stock exchange that approximates the Fund’s NAV every fifteen seconds throughout the trading day.</p>', '<p>Holdings are subject to change.</p>', '<p>Expense ratio: 0.68%</p>\n\n<p>As fund is less than a year old, Since Inception performance shown is cumulative. Short-term performance, in particular, is not a good indication of the fund’s future performance, and an investment should not be made based solely on returns. Because of ongoing market volatility, fund performance may be subject to substantial short-term changes.</p>\n\n<p><em><strong>Performance data quoted on this website represents past performance and does not guarantee future results. Investment return and principal value of an investment will fluctuate so that an investor’s shares, when redeemed or sold in the secondary market, may be worth more or less than the original cost. Investors will incur usual and customary brokerage commissions when buying or selling shares of the exchange-traded funds (“ETFs”) in the secondary market, and that, if reflected, the brokerage commissions would reduce the performance returns. Current performance may be lower or higher than the performance shown. Shares are bought and sold at market price not net asset value (“NAV”) and are not individually redeemable from the fund. Call 877.774.TRUE for more information.</strong></em></p>\n\n<p>Index performance does not represent TrueShares fund performance. It is not possible to invest directly in an index. All performance figures assume reinvestment of dividend and capital gains at net asset value; actual returns may differ. Performance 1-year and less are cumulative; performance over 1-year are average annualized total returns. Market price performance is determined using the bid/ask midpoint at 4:00pm Eastern time, when the NAV is typically calculated. NAV price performance is determined using the daily calculated NAV. They do not represent the returns you would receive if you traded shares at other times. Performance figures do not reflect the deduction of taxes that a shareholder would pay on Fund distributions or upon redemption or sale of fund shares.&nbsp;</p>\n\n<p>The NASDAQ Composite is a stock market index of the common stocks and similar securities listed on the NASDAQ stock market. The index measures the performance of all domestic and international based common type stocks listed on the NASDAQ Stock Market. It includes common stocks, ordinary shares, ADRs, shares of beneficial interest or limited partnership interests and tracking stocks. The index is market capitalization-weighted. The composition of the NASDAQ Composite is heavily weighted towards information technology companies.</p>', '<p>&nbsp;</p>\n\n<p>The 30-Day Yield represents net investment income earned by the Fund over the 30-Day period ended 03/31/2020, expressed as an annual percentage rate based on the Fund’s share price at the end of the 30-Day period.</p>\n\n<p><strong>Before investing, carefully consider the TrueShares ETFs investment objectives, risks, charges and expenses. Specific information about&nbsp;TrueShares is contained in the prospectus and a summary prospectus, copies of which may be obtained by visiting www.true-shares.com. Read the prospectus carefully before you invest. Foreside Fund Services, LLC.</strong></p>\n\n<p>An investment in TrueShares is subject to numerous risks, including possible loss of principal. The ETFs are subject to the following principal risks:&nbsp;<em>Authorized Participants, Market Makers, and Liquidity Providers Concentration Risk</em>&nbsp;associated with ETFs; Equity Market Risk; Management Risk; Market Capitalization Risk (Large Cap; Mid Cap, Small Cap Stock); Market Risk;&nbsp;New Fund Risk: The Fund is a recently organized, non-diversified management investment company with no operating history. As a result, prospective investors have no track record or history on which to base their investment decision. Additionally, the Adviser has not previously managed a registered fund, which may increase the risks of investing in the Fund.</p>\n\n<p>The TrueShares AI &amp; Deep Learning ETF (AI ETF) is also subject to the following risks:&nbsp;<strong>Artificial Intelligence, Machine Learning and Deep Learning Investment Risk</strong>&nbsp;- the extent of such technologies’ versatility has not yet been fully explored. There is no guarantee that these products or services will be successful and the securities of such companies, especially smaller, start-up companies, are typically more volatile than those of companies that do not rely heavily on technology.&nbsp;<strong>Foreign Securities Risk</strong>&nbsp;-The Fund invests in foreign&nbsp;securities&nbsp;which involves certain risks such as currency volatility, political and social instability and reduced market liquidity.&nbsp;<strong>Growth Investing Risk</strong>&nbsp;- The risk of investing in growth stocks that may be more volatile than other stocks because they are more sensitive to investor perceptions of the issuing company’s growth potential.&nbsp;<strong>IPO Risk</strong>&nbsp;- The Fund may invest in companies that have recently completed an initial public offering that are unseasoned equities lacking a trading history, a track record of reporting to investors, and widely available research coverage. IPOs are thus often subject to extreme price volatility and speculative trading.&nbsp;<strong>New Issuer Risk</strong>&nbsp;- Investments in shares of new issuers involve greater risks than investments in shares of companies that have traded publicly on an exchange for extended periods of time.&nbsp;<strong>Non-Diversification Risk</strong>&nbsp;- The Fund is non-diversified which means it may be invested in a limited number of issuers and susceptible to any economic, political and regulatory events than a more diversified fund.</p>\n\n<p>The TrueShares ESG Active Opportunities ETF (ESG ETF) is also subject to the following risk:&nbsp;<strong>Environmental, Social, Governance Risk</strong>&nbsp;- Applying ESG and sustainability criteria to the investment process may exclude securities of certain issuers for non-investment reasons and may cause the Fund to forgo some market opportunities available to funds that do not use ESG or sustainability criteria. ESG considerations may affect its exposure to certain sectors and/or types of investments, and may adversely impact the Fund’s performance depending on whether such sectors or investments are in or out of favor in the market. In addition, the Fund’s investments in certain companies may be susceptible to various factors that may impact their businesses or operations, including costs associated with government budgetary constraints that impact publicly funded projects and clean energy initiatives, the effects of general economic conditions throughout the world, increased competition from other providers of services, unfavorable tax laws or accounting policies and high leverage.</p>\n\n<p>Individual investors should contact their financial advisor or broker dealer representative for more information on TrueShares ETFs.</p>\n\n<p>Investment Products and Services are:&nbsp;<strong>Not FDIC INSURED / May lose value / No bank guarantee</strong></p>\n\n<p>All registered investment companies, including TrueShares, are obliged to distribute portfolio gains to shareholders at year-end regardless of performance. Trading in TrueShares ETFs will also generate tax consequences and transaction expenses. The information provided is not intended to be tax advice. Tax consequences of dividend distributions may vary by individual taxpayer.</p>\n\n<p>TrueShares ETFs are bought and sold through exchange trading at market price, not Net Asset Value (NAV), and are not individually redeemed from the fund. Shares may trade at a premium or discount to their NAV in the secondary market. Brokerage commissions will reduce returns.</p>\n\n<p>ETF shares may be bought or sold throughout the day at their market price, not their NAV, on the exchange on which they are listed. Shares of ETFs are tradable on secondary markets and may trade either at a premium or a discount to their NAV on the secondary market.</p>\n\n<p>ETFs trade like stocks, fluctuate in market value and may trade at prices above or below the ETF\'s NAV. Brokerage commissions and ETF expenses will reduce returns.<br />\n<br />\nTrueShares ETFs (the “Funds”) are registered with the United States Securities and Exchange Commission under the Investment Company Act of 1940 and are distributed by Foreside Funds Services, LLC, member&nbsp;<a href=\"http://www.finra.org/\" target=\"_blank\">FINRA</a>.</p>\n\n<p>TrueMark&nbsp;Investments, LLC, not an affiliate of Foreside Fund Services, LLC, is the investment advisor to the Funds and receives a fee from the Funds for its services.</p>\n\n<p>TrueShares ETFs are offered only to United States residents, and information on this site is intended only for such persons. Nothing on this website should be considered a solicitation to buy nor an offer to sell shares of any fund in any jurisdiction where the offer or solicitation would be unlawful under the securities laws of such jurisdiction.</p>', 1, 'discount-1601555486-Premium-Discount-LRNZ.pdf', 'lrnz', 'LRNZ - The TrueShares AI & Deep Learning Fund', NULL, NULL, 1, 1, '2020-02-17 15:27:45', '2020-10-01 23:02:25', NULL, NULL, NULL, NULL, 'fund_holdings-381582199586-1-HOLDINGS-holdings.xlsx', NULL, 0, 1, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":null},{\"value\":\"Quarter\"},{\"value\":\"1 Year\"},{\"value\":\"5 Year\"},{\"value\":\"Since Inception\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"FUND NAV\"},{\"value\":\"16.69\"},{\"value\":null},{\"value\":null},{\"value\":\"57.13\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"MARKET PRICE\"},{\"value\":\"16.72\"},{\"value\":null},{\"value\":null},{\"value\":\"57.36\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"Nasdaq Composite Total Return Index\"},{\"value\":\"11.24\"},{\"value\":null},{\"value\":null},{\"value\":\"31.06\"}]}]', 1, 'Quarter end returns as of 9/30/2020', '[{\"rtype\":\"CALENDAR_YR_RETURNS\",\"colArray\":[{\"value\":null}]}]', 0, NULL, 0, 'As of 6/1/2020', 0, NULL, 0, NULL, 0, '2020-03-02', NULL),
(2, 'ECOZ', 'TrueShares ESG Active Opportunities ETF', NULL, NULL, NULL, 'banner-1582198822-hero-bg.jpg', '2020-02-28', 'ECOZ', 'ECOZ', '<p>Aims to deliver&nbsp;total return by investing in companies with strong ESG (Environmental, Social, Governance) characteristics and compelling investment profiles.</p>', '<p>ECOZ seeks to provide total return by actively managing a diversiﬁed portfolio of large U.S. companies with attractive investment proﬁles that have also been screened to ensure they meet certain proprietary Environmental, Social, and Governance (ESG) standards, including a particular emphasis on carbon footprint.</p>\n\n<ul>\n	<li>A unique, proprietary screening methodology utilizing both quantitative and qualitative measures in conjunction with fundamental analysis to isolate companies with preferred ESG characteristics and strong long-term opportunities for capital appreciation.&nbsp;</li>\n	<li>Individual evaluation of a company’s Environmental, Social and Governance characteristics within sector context to more accurately identify the most sensitive and relevant ESG categories in each industry, resulting in a more effective analysis than that of more typical binary ESG screens.</li>\n	<li>Invest in your values: our proprietary ESG screening methodology seeks to recognize companies that&nbsp;have a positive impact on the world we live in, or are actively implementing a progressive plan to do so, and avoid those that may carry perceived long-term risks to the global&nbsp;community or the planet itself.&nbsp;</li>\n	<li>Actively managed by highly credentialed ESG and investment professionals</li>\n</ul>', NULL, NULL, '<p>* As of 09/30/2020</p>', '<p>IOPV, or Indicative Optimized Portfolio Value, is a calculation disseminated by the stock exchange that approximates the Fund’s NAV every fifteen seconds throughout the trading day.</p>', '<p>Holdings are subject to change.</p>', '<p>Expense ratio: 0.58%</p>\n\n<p><em><strong>Performance data quoted on this webs