ueShares ETFs are offered only to United States residents, and information on this site is intended only for such persons. Nothing on this website should be considered a solicitation to buy nor an offer to sell shares of any fund in any jurisdiction where the offer or solicitation would be unlawful under the securities laws of such jurisdiction.</p>', 1, 'discount-1601555551-Premium-Discount-ECOZ.pdf', 'ecoz', 'ECOZ - The TrueShares ESG Active Opportunities Fund', NULL, NULL, 2, 1, '2020-02-17 22:41:28', '2020-10-01 23:02:00', NULL, NULL, NULL, NULL, 'fund_holdings-421582199541-1-HOLDINGS-holdings.xlsx', NULL, 0, 1, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":null},{\"value\":\"Quarter\"},{\"value\":\"1 Year\"},{\"value\":\"5 Year\"},{\"value\":\"Since Inception\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"FUND NAV\"},{\"value\":\"13.26\"},{\"value\":null},{\"value\":null},{\"value\":\"23.53\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"MARKET PRICE\"},{\"value\":\"13.30\"},{\"value\":null},{\"value\":null},{\"value\":\"23.79\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"S&P 500\"},{\"value\":\"8.93\"},{\"value\":null},{\"value\":null},{\"value\":\"15.09\"}]}]', 1, 'Quarter end returns as of 09/30/2020', '[{\"rtype\":\"CALENDAR_YR_RETURNS\",\"colArray\":[{\"value\":null}]}]', 1, NULL, 0, NULL, 0, NULL, 0, NULL, 0, '2020-03-02', NULL),
(3, 'JULZ', 'TrueShares Structured Outcome (July) ETF', NULL, NULL, NULL, 'banner-1593585454-product-hero-bg.jpg', '2020-06-30', 'JULZ', 'JULZ', '<p>Gain Structured Outcome exposure to the S&amp;P 500 price index, with upside participation similar to the returns of the S&amp;P 500 and an 8-12% (10% target) downside buffer over a 12-month investment period.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>', '<p>The TrueShares Structured Outcome ETF Series utilizes a “buffer protect” options strategy, that seeks to provide investors with returns (before fees and expenses) that track those of the S&amp;P 500&nbsp;Index while seeking to provide an 8-12% downside buffer (with the advisor targeting 10%) on the first of that index’s losses over a 12-month investment period.**</p>\n\n<p>The JULZ defined investment period begins on July 1, 2020 and resets exactly 12 months later. The strategy is implemented through the purchase and sale of options on the S&amp;P 500 Price Index or an ETF that tracks the S&amp;P 500 Price Return Index. While there is no guarantee the Fund will be successful in providing these outcomes in any period, the intent of the ETFs in the series is to provide uncapped equity market upside participation (subject to options pricing) with a measure of downside risk mitigation. ***</p>\n\n<p>&nbsp;</p>\n\n<p>**&nbsp;<i>In the event an investor purchases Shares after the date on which the options were entered into or sells Shares prior to the expiration of the options, the buffer that the Fund seeks to provide may not be available and there may be limited to no upside potential. The Fund does not provide principal protection and an investor may experience significant losses on its investment, including the loss of its entire investment.&nbsp;</i></p>\n\n<p>***<i>Upside participation over an investment period is subject to options pricing. Due to the cost of the options used by the fund, the correlation of the fund\'s performance to that of the S&amp;P 500 Price Index will be less than if the fund invested directly in the S&amp;P 500 Price Index without using options, and could be substantially less.</i></p>\n\n<p>&nbsp;</p>\n\n<ol start=\"5\" type=\"1\">\n</ol>', NULL, NULL, '<p>*As of 9/30/&nbsp;2020</p>\n\n<p>&nbsp;</p>', '<p>IOPV, or Indicative Optimized Portfolio Value, is a calculation disseminated by the stock exchange that approximates the Fund’s NAV every fifteen seconds throughout the trading day.</p>', '<p>&nbsp;Holdings are subject to change.</p>', '<p>Expense ratio: 0.79%<br />\n<br />\n<strong>Performance data quoted on this website represents past performance and does not guarantee future results. Investment return and principal value of an investment will fluctuate so that an investor’s shares, when redeemed or sold in the secondary market, may be worth more or less than the original cost. Investors will incur usual and customary brokerage commissions when buying or selling shares of the exchange-traded funds (“ETFs”) in the secondary market, and that, if reflected, the brokerage commissions would reduce the performance returns. Current performance may be lower or higher than the performance shown. Shares are bought and sold at market price not net asset value (“NAV”) and are not individually redeemable from the fund. Call 877-774-TRUE (8783)&nbsp;for&nbsp;performance data current to the most recent month end.</strong></p>\n\n<p>Index performance does not represent True-Shares fund performance. It is not possible to invest directly in an index. All performance figures assume reinvestment of dividend and capital gains at net asset value; actual returns may differ. Performance 1-year and less are cumulative; performance over 1-year are average annualized total returns. Market price performance is determined using the bid/ask midpoint at 4:00pm Eastern time, when the NAV is typically calculated. NAV price performance is determined using the daily calculated NAV. They do not represent the returns you would receive if you traded shares at other times. Performance figures do not reflect the deduction of taxes that a shareholder would pay on Fund distributions or upon redemption or sale of fund shares.&nbsp;&nbsp;</p>\n\n<p><strong>Definitions</strong></p>\n\n<p>S&amp;P Downside to Floor of Buffer - How far the S&amp;P 500 would need to fall from its current level before the downside buffer ends. A value of N/A is shown if the S&amp;P 500 Price Index falls below the buffer. Note that this is not a reflection of how much of the buffer has been used, only how far the S&amp;P is away from the lowest level of the buffer.&nbsp; To understand how much buffer remains, look at “Remaining Buffer”.</p>\n\n<p>Remaining Buffer – How much of the downside buffer remains given the current price. ETF Downside Before Buffer – How much the ETF can to lose before the protection buffer level . Remaining Outcome Period – How long until the option structure expires.</p>\n\n<p>Starting NAV – nav at start of the outcome period.</p>\n\n<p>Period Return – Will be 0 as it is always at the start of the period.</p>\n\n<p>SPX Index Reference Price – The S&amp;P 500 Price Index&nbsp;that we will set the structured outcomes on.&nbsp; This is the price that the buffer starts on.</p>\n\n<p>Downside Buffer – The % of downside return of the S&amp;P 500 Price Index from the reference price that is designed to be buffered.&nbsp;</p>\n\n<p>Estimated Upside Market Participation Rate - The estimated upside market participation rate represents the relative exposure of the fund\'s call options to participate in the potential upside movement of the S&amp;P 500 Price Index. This will be determined by the relative price of call and put options at the start of the investment period (12-month period).</p>\n\n<p>Days Remaining – Amount of time until the option structure expires.</p>\n\n<p>Call options - Give the buyer the right, not obligation, to buy shares of the underlying stock at the stated exercise price from the seller of the call option up until the option expires.</p>\n\n<p>Put options &nbsp;- Give the buyer the right, not obligation, to sell shares of the underlying stock at the stated exercise price to the seller of the put option up until the option expires.</p>\n\n<p>Current outcome period values should be data as of the previous close.</p>\n\n<p>Current Price – Price as of date’s close.</p>\n\n<p>Period Return – Return of the ETF from the start of the outcome period to the closing price on the current date.</p>\n\n<p>Remaining Buffer – How much of the downside buffer remains given the current price.</p>\n\n<p>ETF&nbsp;Downside Before Buffer – How much the&nbsp;ETF can to lose before the protection buffer level .</p>\n\n<p>Remaining Outcome Period – How long until the option structure expires.</p>\n\n<p>30-Day Yield - Represents net investment income earned by the Fund expressed as an annual percentage rate based on the Fund\'s share price at the end of a 30-Day period ended on the last day of the month.&nbsp;</p>', '<p><strong>Before investing, carefully consider the TrueShares ETFs investment objectives, risks, charges and expenses. Specific information about&nbsp;TrueShares is contained in the prospectus and a summary prospectus, copies of which may be obtained by visiting www.true-shares.com. Read the prospectus carefully before you invest. Foreside Fund&nbsp;Services, LLC.</strong></p>\n\n<p>An investment in TrueShares is subject to numerous risks, including possible loss of principal. The ETFs are subject to the following principal risks:&nbsp;<em>Authorized Participants, Market Makers, and Liquidity Providers Concentration Risk</em>&nbsp;associated with ETFs; Equity Market Risk; Management Risk; Market Capitalization Risk (Large Cap; Mid Cap, Small Cap Stock); Market Risk;&nbsp;New Fund Risk: The Fund is a recently organized, non-diversified management investment company with no operating history. As a result, prospective investors have no track record or history on which to base their investment decision. Additionally, the Adviser has not previously managed a registered fund, which may increase the risks of investing in the Fund.<br />\n<br />\n<b>The&nbsp;</b><b>TrueShares Structured Outcome ETFS&nbsp;</b><b>&nbsp;have characteristics unlike many other traditional investment products and may not be suitable for all investors. You should only consider an investment in the Fund if you fully understand the inherent risks, which can be found in the prospectus.&nbsp;</b>&nbsp;</p>\n\n<p>TrueShares Structured Outcome ETFS are designed to seek to achieve the investment strategy for investments made on the Initial Investment Day and held until the last day of the Investment Period. Investors purchasing shares in the fund after its 12-month investment period has begun or selling share prior to the end of the investment period, may experience very different results than the fund’s stated investment objective. These periods begin at either the fund’s inception date or at each subsequent “Initial Investment Day”. Following the initial investment period after fund inception, each subsequent investment period will begin each year on the 􀂦rst day of the month the fund was incepted (subsequent “Initial Investment Days”). Fund management will target a 10% downside buffer, with expectations that it will generally fall between 8-12%. The Fund is not designed to protect against declines of more than 8-12% in the level of the S&amp;P 500 Price Index, and there can be no guarantee that the Fund will be successful in implementing the buffer protect options strategy to avoid the first 8-12% decline.&nbsp;</p>\n\n<p>Investments involve risk, including potential loss of principal. The Fund is recently organized with no operating history for prospective investors to base their investment decision which may increase risks. The Fund employs a buffered strategy in an attempt to buffer against losses in the S&amp;P 500 Price Index over the course of a 1-year period. There is no guarantee the Fund will be successful in this strategy, and investors may experience losses beyond targeted levels. In the event an investor purchases Shares after the date on which the options were entered into or sells Shares prior to the expiration of the options, the buffer that the Fund seeks to provide may not be available and there may be limited to no upside potential. The Fund does not provide principal protection and an investor may experience significant losses on its investment, including the loss of its entire investment.&nbsp;</p>\n\n<p>The Fund invests in options, which involves leverage, meaning that a small investment in options could have a substantial impact on the performance of the Fund. The Fund may invest in FLEX Options issued and guaranteed for settlement by the OCC. The Fund bears the risk that the OCC will be unable or unwilling to perform its obligations under the FLEX Options contracts. Additionally, FLEX Options may be illiquid, and in such cases, the Fund may have difficulty closing out certain FLEX Options positions at desired times and prices. As the options the Fund invests in derive their performance from the S&amp;P 500 Price Index, the Fund is subject to the equity market risk associated with the index. The ETF’s portfolio is more volatile than broad market averages.&nbsp;</p>\n\n<p>Additional risks of investing include management, non-diversification, portfolio turnover and tax risks. Detailed information regarding the specific risks of the funds can be found in the prospectus. Individual investors should contact their financial advisor or broker dealer representative for more information on True-Shares ETFs.</p>\n\n<p>The TrueMark AI &amp; Deep Learning ETF (AI ETF) is also subject to the following risks:&nbsp;<strong>Artificial Intelligence, Machine Learning and Deep Learning Investment Risk</strong>&nbsp;- the extent of such technologies’ versatility has not yet been fully explored. There is no guarantee that these products or services will be successful and the securities of such companies, especially smaller, start-up companies, are typically more volatile than those of companies that do not rely heavily on technology.&nbsp;<strong>Foreign Securities Risk</strong>&nbsp;-The Fund invests in foreign&nbsp;securities&nbsp;which involves certain risks such as currency volatility, political and social instability and reduced market liquidity.&nbsp;<strong>Growth Investing Risk</strong>&nbsp;- The risk of investing in growth stocks that may be more volatile than other stocks because they are more sensitive to investor perceptions of the issuing company’s growth potential.&nbsp;<strong>IPO Risk</strong>&nbsp;- The Fund may invest in companies that have recently completed an initial public offering that are unseasoned equities lacking a trading history, a track record of reporting to investors, and widely available research coverage. IPOs are thus often subject to extreme price volatility and speculative trading.&nbsp;<strong>New Issuer Risk</strong>&nbsp;- Investments in shares of new issuers involve greater risks than investments in shares of companies that have traded publicly on an exchange for extended periods of time.&nbsp;<strong>Non-Diversification Risk</strong>&nbsp;- The Fund is non-diversified which means it may be invested in a limited number of issuers and susceptible to any economic, political and regulatory events than a more diversified fund.</p>\n\n<p>The TrueMark ESG Active Opportunities ETF (ESG ETF) is also subject to the following risk:&nbsp;<strong>Environmental, Social, Governance Risk</strong>&nbsp;- Applying ESG and sustainability criteria to the investment process may exclude securities of certain issuers for non-investment reasons and may cause the Fund to forgo some market opportunities available to funds that do not use ESG or sustainability criteria. ESG considerations may affect its exposure to certain sectors and/or types of investments, and may adversely impact the Fund’s performance depending on whether such sectors or investments are in or out of favor in the market. In addition, the Fund’s investments in certain companies may be susceptible to various factors that may impact their businesses or operations, including costs associated with government budgetary constraints that impact publicly funded projects and clean energy initiatives, the effects of general economic conditions throughout the world, increased competition from other providers of services, unfavorable tax laws or accounting policies and high leverage.</p>\n\n<p>Individual investors should contact their financial advisor or broker dealer representative for more information on TrueShares ETFs.</p>\n\n<p>Investment Products and Services are:&nbsp;<strong>Not FDIC INSURED / May lose value / No bank guarantee</strong></p>\n\n<p>All registered investment companies, including TrueShares, are obliged to distribute portfolio gains to shareholders at year-end regardless of performance. Trading in TrueShares ETFs will also generate tax consequences and transaction expenses. The information provided is not intended to be tax advice. Tax consequences of dividend distributions may vary by individual taxpayer.</p>\n\n<p>TrueShares ETFs are bought and sold through exchange trading at market price, not Net Asset Value (NAV), and are not individually redeemed from the fund. Shares may trade at a premium or discount to their NAV in the secondary market. Brokerage commissions will reduce returns.</p>\n\n<p>ETF shares may be bought or sold throughout the day at their market price, not their NAV, on the exchange on which they are listed. Shares of ETFs are tradable on secondary markets and may trade either at a premium or a discount to their NAV on the secondary market.</p>\n\n<p>ETFs trade like stocks, fluctuate in market value and may trade at prices above or below the ETF\'s NAV. Brokerage commissions and ETF expenses will reduce returns.<br />\n<br />\nTrueShares ETFs (the “Funds”) are registered with the United States Securities and Exchange Commission under the Investment Company Act of 1940 and are distributed by Foreside Funds Services, LLC, member&nbsp;<a href=\"http://www.finra.org/\" target=\"_blank\">FINRA</a>.</p>\n\n<p>TrueMark Investments, LLC, not an affiliate of Foreside Fund Services, LLC, is the investment advisor to the Funds and receives a fee from the Funds for its services.</p>\n\n<p>TrueShares ETFs are offered only to United States residents, and information on this site is intended only for such persons. Nothing on this website should be considered a solicitation to buy nor an offer to sell shares of any fund in any jurisdiction where the offer or solicitation would be unlawful under the securities laws of such jurisdiction.</p>\n\n<p>Outcome period values definitions are data as&nbsp; July 1, 2020</p>\n\n<p>&nbsp;</p>', 1, 'discount-1601555605-Premium-Discount-JULZ.pdf', 'julz', 'JULZ', NULL, NULL, 3, 1, '2020-07-01 06:37:34', '2020-10-01 23:05:37', NULL, NULL, NULL, NULL, NULL, NULL, 0, 1, NULL, NULL, 1, 1, NULL, NULL, NULL, NULL, NULL, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '[{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":null},{\"value\":\"Quarter\"},{\"value\":\"1 Year\"},{\"value\":\"5 Year\"},{\"value\":\"Since Inception\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"FUND NAV\"},{\"value\":\"6.46\"},{\"value\":null},{\"value\":null},{\"value\":\"6.46\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"MARKET PRICE\"},{\"value\":\"6.73\"},{\"value\":null},{\"value\":null},{\"value\":\"6.73\"}]},{\"rtype\":\"CUMULATIVE_RETURNS\",\"colArray\":[{\"value\":\"S&P 500\"},{\"value\":\"8.47\"},{\"value\":null},{\"value\":null},{\"value\":\"8.47\"}]}]', 1, 'Quarter end returns as of 9/30/2020', '[{\"rtype\":\"CALENDAR_YR_RETURNS\",\"colArray\":[{\"value\":null}]}]', 1, NULL, 1, 'As of 7/1/2020', 1, NULL, 