INSERT INTO `tbl_interim_fund` (`id`, `fund_name`, `sub_title`, `menu_title`, `banner_image`, `fund_ticker`, `fund_description`, `fund_launch_description`, `fund_detail_notes`, `fund_disclosure`, `url_key`, `meta_title`, `meta_description`, `meta_keyword`, `position`, `status`, `created_at`, `updated_at`) VALUES
(1, 'DECZ', 'TrueShares Structured Outcome (December) ETF', '', 'banner-1604295411-product-hero-bg.jpg', 'DECZ', '<p>The TrueShares Structured Outcome ETF Series utilizes a “buffer protect” options strategy, that seeks to provide investors with returns (before fees and expenses) that track those of the S&amp;P 500 Index while seeking to provide an 8-12% downside buffer (with the advisor targeting 10%) on the first&nbsp;of that index’s losses over a 12-month investment period.**<br />\n<br />\nThe DECZ defined investment period begins on December 1, 2020 and resets exactly 12 months later. The strategy is implemented through the purchase and sale of options on the S&amp;P 500 Price Index or an ETF that tracks the S&amp;P 500 Price Return Index. While there is no guarantee the Fund will be successful in providing these outcomes in any period, the intent of the ETFs in the series is to provide uncapped equity market upside participation (subject to options pricing) with a measure of downside risk mitigation. ***<br />\n<br />\n** In the event an investor purchases Shares after the date on which the options were entered into or sells Shares prior to the expiration of the options, the buffer that the Fund seeks to provide may not be available and there may be limited to no upside potential. The Fund does not provide principal protection and an investor may experience significant losses on its investment, including the loss of its entire investment.</p>\n\n<p><br />\n***Upside participation over an investment period is subject to options pricing. Due to the cost of the options used by the fund, the correlation of the fund\'s performance to that of the S&amp;P 500 Price Index will be less than if the fund invested directly in the S&amp;P 500 Price Index without using options, and could be substantially less.</p>', '<h3 style=\"font-size:16px;color:#2f5363;font-weight:900;margin-bottom:10px;\">Launching December 1.</h3>\n\n<h4 style=\"font-size:14px;color:#2f5363;font-weight:900;\">FOR MORE INFORMATION, PLEASE EMAIL US <a class=\"contactPop\" href=\"javascript:void(0)\">HERE</a>.</h4>\n\n<h4><span style=\"font-size:16px;\"><strong>As of 11/23/2020, the estimated upside market participation rate range is 80-85%.<sup>1</sup>.&nbsp;</strong></span></h4>\n\n<p>&nbsp;</p>\n\n<p><br />\n1. The estimated participation ranges represent the estimated highest and lowest upside participation rates are based on the historical daily options pricing for the options that would have been utilized to implement the strategy as described in the prospectus (out of the money puts and at the money calls) for the business days from 11/19/2020 -11/23/2020 and are shown gross of the 0.79% annual operating expenses for the ETF. It does not represent the actual upside participation rate that will be set on the first day of the investment period, which may fall outside the stated cap ranges, due to extreme market volatility.</p>', '*As of December 1, 2020', '<p><strong>Before investing, carefully consider the True-Shares ETFs investment objectives, risks, charges and expenses. Specific information about the True-Shares is contained in the prospectus and a summary prospectus, copies of which may be obtained by visiting www.true-shares.com. Read the prospectus carefully before you invest. Foreside Fund&nbsp;Services, LLC, Distribtor.</strong></p>\n\n<p>An investment in True-Shares is subject to numerous risks, including possible loss of principal. The ETFs are subject to the following principal risks: <em>Authorized Participants, Market Makers, and Liquidity Providers Concentration Risk</em> associated with ETFs; Equity Market Risk; Management Risk; Market Capitalization Risk (Large Cap; Mid Cap, Small Cap Stock); Market Risk; New Fund Risk. A full description of risks is in the prospectus.</p>\n\n<p><strong>The TrueShares Structured Outcome ETFS&nbsp; have characteristics unlike many other traditional investment products and may not be suitable for all investors. You should only consider an investment in the Fund if you fully understand the inherent risks, which can be found in the prospectus. &nbsp;</strong></p>\n\n<p>TrueShares Structured Outcome ETFS are designed to seek to achieve the investment strategy for investments made on the Initial Investment Day and held until the last day of the Investment Period. Investors purchasing shares in the fund after its 12-month investment period has begun or selling share prior to the end of the investment period, may experience very different results than the fund’s stated investment objective. These periods begin at either the fund’s inception date or at each subsequent “Initial Investment Day”. Following the initial investment period after fund inception, each subsequent investment period will begin each year on the first day of the month the fund was incepted (subsequent “Initial Investment Days”). Fund management will target a 10% downside buffer, with expectations that it will generally fall between 8-12%. The Fund is not designed to protect against declines of more than 8-12% in the level of the S&amp;P 500 Price Index, and there can be no guarantee that the Fund will be successful in implementing the buffer protect options strategy to avoid the first 8-12% decline.</p>\n\n<p>Investments involve risk, including potential loss of principal. The Fund is recently organized with no operating history for prospective investors to base their investment decision which may increase risks. The Fund employs a buffered strategy in an attempt to buffer against losses in the S&amp;P 500 Price Index over the course of a 1-year period. There is no guarantee the Fund will be successful in this strategy, and investors may experience losses beyond targeted levels. In the event an investor purchases Shares after the date on which the options were entered into or sells Shares prior to the expiration of the options, the buffer that the Fund seeks to provide may not be available and there may be limited to no upside potential. The Fund does not provide principal protection and an investor may experience significant losses on its investment, including the loss of its entire investment.</p>\n\n<p>The Fund invests in options, which involves leverage, meaning that a small investment in options could have a substantial impact on the performance of the Fund. The Fund may invest in FLEX Options issued and guaranteed for settlement by the OCC. The Fund bears the risk that the OCC will be unable or unwilling to perform its obligations under the FLEX Options contracts. Additionally, FLEX Options may be illiquid, and in such cases, the Fund may have difficulty closing out certain FLEX Options positions at desired times and prices. As the options the Fund invests in derive their performance from the S&amp;P 500 Price Index, the Fund is subject to the equity market risk associated with the index. The ETF’s portfolio is more volatile than broad market averages.</p>\n\n<p>Additional risks of investing include management, non-diversification, portfolio turnover and tax risks. Detailed information regarding the specific risks of the funds can be found in their prospectuses.Individual investors should contact their financial advisor or broker dealer representative for more information on True-Shares ETFs.</p>\n\n<p>Individual investors should contact their financial advisor or broker dealer representative for more information on TrueShares ETFs.</p>\n\n<p>Investment Products and Services are: <strong>Not FDIC INSURED / May lose value / No bank guarantee</strong></p>\n\n<p>All registered investment companies, including True-Shares, are obliged to distribute portfolio gains to shareholders at year-end regardless of performance. Trading in True-Shares ETFs will also generate tax consequences and transaction expenses. The information provided is not intended to be tax advice. Tax consequences of dividend distributions may vary by individual taxpayer.</p>\n\n<p>True-Shares ETFs are bought and sold through exchange trading at market price, not Net Asset Value (NAV), and are not individually redeemed from the fund. Shares may trade at a premium or discount to their NAV in the secondary market. Brokerage commissions will reduce returns.</p>\n\n<p>ETF shares may be bought or sold throughout the day at their market price, not their NAV, on the exchange on which they are listed. Shares of ETFs are tradable on secondary markets and may trade either at a premium or a discount to their NAV on the secondary market.</p>\n\n<p>ETFs trade like stocks, fluctuate in market value and may trade at prices above or below the ETF\'s NAV. Brokerage commissions and ETF expenses will reduce returns.</p>\n\n<p>True-Shares ETFs (the “Funds”) are registered with the United States Securities and Exchange Commission under the Investment Company Act of 1940 and are distributed by Foreside Fund&nbsp;Services, LLC, member <a href=\"http://www.finra.org/\" target=\"_blank\">FINRA</a> and <a href=\"\">SIPC</a> .</p>\n\n<p><strong>Find out more about the background of this firm on <a href=\"\">FINRA\'s BrokerCheck</a>.</strong></p>\n\n<p>TrueMark Investments, LLC, not an affiliate of Foreside Fund&nbsp;Services, LLC., is the investment advisor to the Funds and receives a fee from the Funds for its services.</p>\n\n<p>True-Shares ETFs are offered only to United States residents, and information on this site is intended only for such persons. Nothing on this website should be considered a solicitation to buy nor an offer to sell shares of any fund in any jurisdiction where the offer or solicitation would be unlawful under the securities laws of such jurisdiction.</p>', 'decz', 'decz', NULL, NULL, 0, 1, NULL, '2020-11-24 02:28:34');
