(25, 'Diversified Versus Concentrated Strategy – Which Is Best for You?', 'U.S. News', '2020-06-18', NULL, 'URL', NULL, 'https://money.usnews.com/investing/investing-101/articles/diversified-strategy-versus-concentrated-strategy-which-is-best-for-you', NULL, NULL, 1, 24, 0, NULL, 0, NULL, '2020-06-28 23:52:39', '2020-06-28 23:52:39'),
(26, 'JULZ Press Release', 'TrueShares', '2020-07-01', NULL, 'FILE', 'NEWS_FILE-1593587837-TrueMark-Structured-Outcome-JULZ-ETF-press-Release-FINAL.pdf', NULL, NULL, NULL, 1, 0, 0, NULL, 0, '<strong>The Fund\'s investment objectives, risks, charges and expenses should be considered carefully before investing. The prospectus contains this and other important information, and it may be obtained at https://www.true-shares.com/julz. Read it carefully before investing. Foreside Fund Services, LLC, distributor.</strong><br />\n&nbsp;<br />\n<strong>The Fund has characteristics unlike many other traditional investment products and may not be suitable for all investors. You should only consider an investment in the Fund if you fully understand the inherent risks, which can be found in the prospectus.</strong><br />\n&nbsp;<br />\n<strong>Investing involves risks. Loss of principal is possible.&nbsp; </strong>&nbsp;There is no guarantee the fund will achieve its investment objective.<br />\n&nbsp;<br />\nThe TrueShares Structured Outcome ETFs seek to provide investors with returns (before fees and expenses) that track those of the S&amp;P 500 Price Return Index (the “S&amp;P 500 Price Index”) while seeking to provide a buffer against the first 8% to 12% of S&amp;P 500 Price Index losses, over a one year period without a Cap on potential upside returns. The Fund is recently organized with no operating history for prospective investors to base their investment decision which may increase risks.<br />\n&nbsp;<br />\nThe Fund employs a buffered strategy in an attempt to buffer against losses in the S&amp;P 500 Price Index over the course of a 1-year period. There is no guarantee the Fund will be successful in this strategy, and investors may experience losses beyond targeted levels.<br />\n&nbsp;<br />\nDue to the cost of the options used by the Fund, the correlation of the Fund\'s performance to that of the S&amp;P 500 Price Index will be less than if the fund invested directly in the S&amp;P 500 Price Index without using options, and could be substantially less.&nbsp; The Funds are designed to seek to achieve their investment objective for investments made on the first day of an Investment Period and held until the last day of the Investment Period. In the event an investor purchases Shares after the date the&nbsp; which the options were entered into or sells Shares prior to the last day of the Investment period, the buffer that the Fund seeks to provide may not be available and there may be limited to no upside potential. The Fund does not provide principal protection and an investor may experience significant losses on its investment, including the loss of its entire investment.', '2020-07-01 07:17:17', '2020-08-21 15:45:55'),
(27, 'Michael Loukas On the Work From Home Impact On Overall Economy', 'TD Ameritrade Network', '2020-06-19', NULL, 'URL', NULL, 'https://tdameritradenetwork.com/video/rB4AoXLQG8CBcuIjcXIEdQ', NULL, NULL, 1, 3, 1, NULL, 1, '&nbsp;\n<div>\n<div id=\"_com_2\" uage=\"JavaScript\"><span style=\"font-size:14px;\"><strong>LRNZ current holdings can be viewed <a href=\"https://true-shares.com/lrnz\">here</a>.</strong><br />\n<br />\nAll views represent the opinion of Mike Loukas, CEO TrueMark Investments, as of June 19, 2020.</span><br />\n<br />\n<br />\n&nbsp;</div>\n</div>', '2020-07-01 21:24:48', '2020-08-21 15:50:11'),
