INSERT INTO `tbl_resource_content_disclosure` (`id`, `title`, `banner_img`, `disclosure`, `meta_title`, `meta_description`, `meta_keyword`, `created_at`, `updated_at`) VALUES
(1001, 'Resources', 'BANNER-1581934451-hero-bg.jpg', '<p><strong>Before investing, carefully consider the TrueShares ETFs investment objectives, risks, charges and expenses. Specific information about&nbsp;TrueShares is contained in the prospectus and a summary prospectus, copies of which may be obtained by visiting www.true-shares.com. Read the prospectus carefully before you invest. Foreside Fund Services, LLC.</strong></p>\n\n<p>An investment in TrueShares is subject to numerous risks, including possible loss of principal. The ETFs are subject to the following principal risks:&nbsp;<em>Authorized Participants, Market Makers, and Liquidity Providers Concentration Risk</em>&nbsp;associated with ETFs; Equity Market Risk; Management Risk; Market Capitalization Risk (Large Cap; Mid Cap, Small Cap Stock); Market Risk;&nbsp;New Fund Risk: The Fund is a recently organized, non-diversified management investment company with no operating history. As a result, prospective investors have no track record or history on which to base their investment decision. Additionally, the Adviser has not previously managed a registered fund, which may increase the risks of investing in the Fund.</p>\n\n<p>The TrueShares AI &amp; Deep Learning ETF (AI ETF) is also subject to the following risks:&nbsp;<strong>Artificial Intelligence, Machine Learning and Deep Learning Investment Risk</strong>&nbsp;- the extent of such technologies’ versatility has not yet been fully explored. There is no guarantee that these products or services will be successful and the securities of such companies, especially smaller, start-up companies, are typically more volatile than those of companies that do not rely heavily on technology.&nbsp;<strong>Foreign Securities Risk</strong>&nbsp;-The Fund invests in foreign&nbsp;securities&nbsp;which involves certain risks such as currency volatility, political and social instability and reduced market liquidity.&nbsp;<strong>Growth Investing Risk</strong>&nbsp;- The risk of investing in growth stocks that may be more volatile than other stocks because they are more sensitive to investor perceptions of the issuing company’s growth potential.&nbsp;<strong>IPO Risk</strong>&nbsp;- The Fund may invest in companies that have recently completed an initial public offering that are unseasoned equities lacking a trading history, a track record of reporting to investors, and widely available research coverage. IPOs are thus often subject to extreme price volatility and speculative trading.&nbsp;<strong>New Issuer Risk</strong>&nbsp;- Investments in shares of new issuers involve greater risks than investments in shares of companies that have traded publicly on an exchange for extended periods of time.&nbsp;<strong>Non-Diversification Risk</strong>&nbsp;- The Fund is non-diversified which means it may be invested in a limited number of issuers and susceptible to any economic, political and regulatory events than a more diversified fund.</p>\n\n<p>The TrueShares&nbsp;ESG Active Opportunities ETF (ESG ETF) is also subject to the following risk:&nbsp;<strong>Environmental, Social, Governance Risk</strong>&nbsp;- Applying ESG and sustainability criteria to the investment process may exclude securities of certain issuers for non-investment reasons and may cause the Fund to forgo some market opportunities available to funds that do not use ESG or sustainability criteria. ESG considerations may affect its exposure to certain sectors and/or types of investments, and may adversely impact the Fund’s performance depending on whether such sectors or investments are in or out of favor in the market. In addition, the Fund’s investments in certain companies may be susceptible to various factors that may impact their businesses or operations, including costs associated with government budgetary constraints that impact publicly funded projects and clean energy initiatives, the effects of general economic conditions throughout the world, increased competition from other providers of services, unfavorable tax laws or accounting policies and high leverage.</p>\n\n<p>Individual investors should contact their financial advisor or broker dealer representative for more information on TrueShares ETFs.</p>\n\n<p>Investment Products and Services are:&nbsp;<strong>Not FDIC INSURED / May lose value / No bank guarantee</strong></p>\n\n<p>All registered investment companies, including TrueShares, are obliged to distribute portfolio gains to shareholders at year-end regardless of performance. Trading in TrueShares ETFs will also generate tax consequences and transaction expenses. The information provided is not intended to be tax advice. Tax consequences of dividend distributions may vary by individual taxpayer.</p>\n\n<p>TrueShares ETFs are bought and sold through exchange trading at market price, not Net Asset Value (NAV), and are not individually redeemed from the fund. Shares may trade at a premium or discount to their NAV in the secondary market. Brokerage commissions will reduce returns.</p>\n\n<p>ETF shares may be bought or sold throughout the day at their market price, not their NAV, on the exchange on which they are listed. Shares of ETFs are tradable on secondary markets and may trade either at a premium or a discount to their NAV on the secondary market.</p>\n\n<p>ETFs trade like stocks, fluctuate in market value and may trade at prices above or below the ETF\'s NAV. Brokerage commissions and ETF expenses will reduce returns.<br />\n<br />\nTrueShares ETFs (the “Funds”) are registered with the United States Securities and Exchange Commission under the Investment Company Act of 1940 and are distributed by Foreside Funds Services, LLC, member&nbsp;<a href=\"http://www.finra.org/\" target=\"_blank\">FINRA</a>.</p>\n\n<p>TrueMark Investments, LLC, not an affiliate of Forside Fund Services, LLC., is the investment advisor to the Funds and receives a fee from the Funds for its services.</p>\n\n<p>TrueShares ETFs are offered only to United States residents, and information on this site is intended only for such persons. Nothing on this website should be considered a solicitation to buy nor an offer to sell shares of any fund in any jurisdiction where the offer or solicitation would be unlawful under the securities laws of such jurisdiction.</p>', 'Resources', NULL, NULL, NULL, '2020-07-01 23:02:06');
