(3, 'Jeremy Brandt', 'TITLE', 'Craig has over 25 years of financial services experience and serves as Private Wealth Advisor and Managing Partner of SkyOak Wealth. He serves on the investment committee and has broad experience in the capital markets including equities, fixed income, options and alternative investments.<br />\n<br />\nIn 2001, Craig co-founded Platinum Financial Partners, an institutional money management firm specializing in the use of Artificial Intelligencebased models for managing portfolios of Exchange Traded Funds. In 2000, he co-founded BKS Advisors, LLC. Prior to, he joined Edward Jones as an Investment Representative and managed office locations in West Bloomfield and Lake Orion, Michigan. He later moved his practice to Smith Barney in 1995 to form a business partnership with Ken Brandt, where one year later, they formed an RIA specializing in working with independent fee-based money managers. Craig began his financial career as an auditor for Hilton Hotels. He is a graduate of Central Michigan University', NULL, 2, 1, '2020-11-26 06:30:26', '2020-11-26 06:39:24'),
